		{
			"_uuid": "38d358a6ca6c4a94a881c4a5fdd31626",
			"current_frame": "normal",
			"custom": true,
			"label": "_1be301c2",
			"on_talk": "if(had_conversation_with_me_already__section('described_conveyance'),
	           [  speech_dialog(self, [~Enjoy your trip on the CONVEYANCE!\\nJust don't let the critters scare you off!~]) ],
	
	           [ speech_dialog(		self,			[~Hi there, sonny!~],
	           										[~Have you come here\\nto ride on the CONVEYANCE?~],
	              									set(level.player.animation, 'emote_confused'),
			   						level.player,	[~Uhh...\\nWill this get me across the river?~],
			   						self, 			[~Sure thing it will!~],
			   										[~In fact, since it's the only way at the moment,\\nI'm doing a public service by making it free.~],
	           		   								set(level.player.animation, 'emote_talk'),
			   						level.player,	[~That's nice.~],	
			   						self,			[~Yessir, climb aboard the CONVEYANCE\\nfor the ride of your life!~],
	              									set(level.player.animation, 'emote_confused'),
			   						level.player,	[~Hold on, I'm confused...\\nWhat's with this whole 'carnival' act?~],	
	              									set(level.player.animation, 'emote_geez'),
			   										[~Are you some kind of amateur showman?~],
			   						self, 			[~Ho! Not at all, not at all.\\nI'm a bonafide professional!~],
			   										[~This, here, is normally an amusement park.\\nPeople pay to ride it.~],
			   										[~It happens to cross the river though,\\nso we thought it'd be a good promotion to let\\npeople use it for free during the bridge outage.~],
	              									set(level.player.animation, 'emote_oh'),
			   						level.player,	[~Yes, but isn't there like ... some kinda\\nmaintenance catwalk or something?~],
	              									set(level.player.animation, 'emote_geez'),
			   										[~I mean, what if people don't want to ride?~],
			   						self, 			[~Wouldn't be a promotion if they didn't\\nexperience our trademark EXCITEMENT!~],
			   										[~Anyone who tries it, loves it!\\nCome on, don't be shy...~],
			   						level.player,	[~...~],
	              									set(level.player.animation, 'emote_raisedfinger'),
			   						level.player,	[~With all due respect, sir...\\nI think this is just plain nuts.~],
				                    self,			[~Ha! They said my grandfather was crazy,\\nwhen he built it.~],
				                    				[~But who's crazy now, eh?~]),
			   set(level.zoom, 1),
			   record_having_conversation__section('described_conveyance')
			   ])",
